DROP PROCEDURE IF EXISTS proc_init_data_set;
DELIMITER $	

CREATE PROCEDURE proc_init_data_set()
BEGIN
    INSERT INTO data_set(village_id, question_id, question, answer, count)
	SELECT v.village_id, q.id, q.question_content as question, qa.answer_content as answer, (select if(q.question_type = "TextFieldNumber", 1,0)) as count
	FROM village v join sr_survey_question q join sr_survey_question_answer qa on q.id=qa.sr_sq_id where q.required;
END $
 
DELIMITER ;

DROP PROCEDURE IF EXISTS proc_insert_new_data_set;
DELIMITER $	

CREATE PROCEDURE proc_insert_new_data_set(in id int, OUT affectedRows int)
BEGIN
	set affectedRows = 0;
    INSERT INTO data_set(village_id, question_id, question, answer, count)
	SELECT v.village_id, q.id, q.question_content as question, qa.answer_content as answer, (select if(q.question_type = "TextFieldNumber", 1,0)) as count
	FROM village v join sr_survey_question q join sr_survey_question_answer qa on q.id=qa.sr_sq_id where q.required and v.village_id=id;
    set affectedRows = affectedRows + (SELECT ROW_COUNT());
END $
 
DELIMITER ;

DROP PROCEDURE IF EXISTS proc_update_data_set_by_village_id;
DELIMITER $	

CREATE PROCEDURE proc_update_data_set_by_village_id(IN id int, OUT affectedRows int)
BEGIN
	set affectedRows = 0;
	update data_set ds ,
	(SELECT v.village_id, q.id as question_id, (select cast(round(avg(temp_h.answer_content), 2) as char(10)) from household_survey temp_h join ur_user temp_u on temp_h.household=temp_u.id where temp_h.sr_sqa_id=qa.id and v.village_id=temp_u.village_id) as answer, 1 as count
	FROM household_survey hs join ur_user u on u.id=hs.household join village v on v.village_id=u.village_id join sr_survey_question_answer qa on qa.id=hs.sr_sqa_id join sr_survey_question q on q.id=qa.sr_sq_id
	where q.question_type = "TextFieldNumber" and q.required and v.village_id = id
	group by v.village_id, q.question_content, qa.answer_content, q.id) as temp
	set ds.answer = temp.answer
	where ds.village_id = temp.village_id and ds.question_id = temp.question_id;
	set affectedRows = affectedRows + (SELECT ROW_COUNT());
	update data_set ds ,
	(SELECT v.village_id, q.id as question_id, qa.answer_content as answer, count(*) as count
	FROM household_survey hs join ur_user u on u.id=hs.household join village v on v.village_id=u.village_id join sr_survey_question_answer qa on qa.id=hs.sr_sqa_id join sr_survey_question q on q.id=qa.sr_sq_id
	where q.question_type != "TextFieldNumber" and q.required and v.village_id = id
	group by v.village_id, q.question_content, qa.answer_content, q.id) as temp
	set ds.count = temp.count
	where ds.village_id = temp.village_id and ds.question_id = temp.question_id and ds.answer=temp.answer;
    set affectedRows = affectedRows + (SELECT ROW_COUNT());
END $
 
DELIMITER ;

CALL proc_init_data_set();
